/*

Logical Operators
&& --> AND --> a < b && b > c      both conditions have to be satisfied
|| --> OR --> a < b || b > c       either conditions must be satisfied
! - NOT --> !(a > b)              

Bitwise operators
& --> AND
| --> OR
^ --> XOR

