    // create a function that will multiply a by b 

contract MultiplyAbyB{

    uint a = 17;
    uint b = 32;

    function multiply () public view returns(uint){
        uint result = 0;
        if(b > a && a != b){
            result =  a * b;
        }
        return result;

    }
}

